	Mag();
	Crane();
	Stamp();
	IF((Actuator_MagazinGreenLamp) AND (Actuator_StampGreenLamp))THEN
		IF((Stamp.StartCommandStamp) AND (Crane.StartCommandCrane) AND (Mag.StartCommandMagazin))THEN
			Crane.StartVar := TRUE;
